void ShellSort :: funcao_Shell(vector<int>&arr, int n){
    for (int gap = n/2; gap > 0; gap /= 2){
        for (int i = gap; i < n; i += 1){
    
            int temp = arr[i];
            int j; 

            for (j = i; j >= gap && arr[j - gap] > temp; j -= gap){
                arr[j] = arr[j - gap];
            }
              
            arr[j] = temp;
        }
    }
}
  
void ShellSort :: printArray(vector<int>arr, int n){
    for (int i=0; i<n; i++){
        cout << arr[i] << " ";

    }
}
